import React, { Component } from "react";
import Swiper from "react-id-swiper";

class Gallery extends Component {
    render() {
        const params = {
            slidesPerView: "auto",
            spaceBetween: 30,
            pagination: {
                el: ".swiper-pagination",
                clickable: true
            }
        };
        return (
            <div>
                <Swiper {...params}>
                   <img src="" className="img-fluid" alt="slide"/>
                </Swiper>
            </div>
        );
    }
}

export default Gallery;
